<html lang="en"><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    
    <title>Suezanne's Market DJ Booth</title>
    <style>
        
    .audio-upload {
        background: rgba(0, 0, 0, 0.3);
        padding: 15px;
        border-radius: 10px;
        margin-bottom: 20px;
        border: 2px solid #00ff9d;
    }
    .audio-upload label {
        display: block;
        padding: 10px;
        background: #2a1a4a;
        border-radius: 5px;
        color: #00ff9d;
        text-align: center;
        cursor: pointer;
        margin-bottom: 10px;
    }
    .audio-upload input[type="file"] {
        display: none;
    }
    .transport-controls {
        display: flex;
        gap: 10px;
        margin-top: 10px;
    }
    .transport-button {
        background: #2a1a4a;
        border: 2px solid #00ff9d;
        color: #00ff9d;
        padding: 10px 20px;
        border-radius: 5px;
        cursor: pointer;
        flex: 1;
    }
    .transport-button:hover {
        background: #00ff9d;
        color: #2a1a4a;
    }
    .current-track {
        color: #00ff9d;
        font-size: 0.9em;
        margin-top: 5px;
        text-align: center;
    }
    
    .llama-console {
        background: #1a1a1a;
        border: 2px solid #00ff9d;
        border-radius: 10px;
        margin: 20px 0;
        font-family: 'Courier New', monospace;
    }
    .console-header {
        background: #2a1a4a;
        padding: 10px;
        color: #00ff9d;
        display: flex;
        justify-content: space-between;
        align-items: center;
        border-bottom: 2px solid #00ff9d;
    }
    .run-button {
        background: #00ff9d;
        border: none;
        padding: 5px 15px;
        border-radius: 5px;
        cursor: pointer;
        font-weight: bold;
    }
    .console-input {
        background: #000;
        color: #00ff9d;
        padding: 15px;
        min-height: 100px;
        outline: none;
        font-size: 14px;
    }
    .console-output {
        background: #0a0a0a;
        color: #00ff9d;
        padding: 15px;
        border-top: 1px solid #333;
        white-space: pre;
    }
    .audio-filters {
        background: rgba(0, 0, 0, 0.3);
        padding: 15px;
        border-radius: 10px;
        margin: 20px 0;
        border: 2px solid #00ff9d;
    }
    .filter-knobs {
        display: flex;
        justify-content: space-around;
        gap: 20px;
    }
    .filter-knob {
        text-align: center;
    }
    .filter-knob label {
        color: #00ff9d;
        display: block;
        margin-bottom: 5px;
    }
    .knob {
        width: 60px;
        height: 60px;
        background: #2a1a4a;
        border: 2px solid #00ff9d;
        border-radius: 50%;
        position: relative;
        cursor: pointer;
    }
    .knob::after {
        content: '';
        position: absolute;
        top: 50%;
        left: 50%;
        width: 2px;
        height: 25px;
        background: #00ff9d;
        transform-origin: bottom;
        transform: translate(-50%, -100%) rotate(0deg);
    }
    body {
            background: linear-gradient(45deg, #1a0033, #000033);
            color: #00ff9d;
            font-family: 'Arial', sans-serif;
            margin: 0;
            padding: 20px;
            min-height: 100vh;
        }
        .dj-booth {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 20px;
            max-width: 1200px;
            margin: 0 auto;
        }
        .llama-booth {
            text-align: center;
        }
        .llama-container {
            width: 400px;
            height: 400px;
            position: relative;
            margin: 20px auto;
        }

            background-size: contain;
            background-repeat: no-repeat;
            background-position: center;

        }
        .value-display {
            font-size: 2em;
            text-align: center;
            margin: 20px;
            text-shadow: 0 0 10px #00ff9d;
            font-family: 'Courier New', monospace;
        }
        .dj-controls {
            background: rgba(0, 0, 0, 0.5);
            padding: 20px;
            border-radius: 15px;
        }
        .fx-section {
            display: grid;
            grid-template-columns: repeat(2, 1fr);
            gap: 15px;
            margin-bottom: 20px;
        }
        .fx-button {
            background: #2a1a4a;
            border: 2px solid #00ff9d;
            color: #00ff9d;
            padding: 15px;
            border-radius: 10px;
            cursor: pointer;
            font-size: 1.2em;
            transition: all 0.3s;
        }
        .fx-button:active {
            background: #00ff9d;
            color: #2a1a4a;
        }
        .fx-pad {
            width: 100%;
            height: 200px;
            background: rgba(0, 255, 157, 0.1);
            border: 2px solid #00ff9d;
            border-radius: 10px;
            margin-top: 20px;
            cursor: crosshair;
            position: relative;
        }
        .fx-pad::after {
            content: 'Market FX Pad';
            position: absolute;
            top: -25px;
            left: 50%;
            transform: translateX(-50%);
            color: #00ff9d;
        }
        .beat-controls {
            display: flex;
            align-items: center;
            justify-content: space-between;
            margin-top: 20px;
            padding: 15px;
            background: rgba(0, 0, 0, 0.3);
            border-radius: 10px;
        }
        .beat-slider {
            -webkit-appearance: none;
            width: 200px;
            height: 10px;
            border-radius: 5px;
            background: #2a1a4a;
            outline: none;
        }
        .beat-slider::-webkit-slider-thumb {
            -webkit-appearance: none;
            width: 20px;
            height: 20px;
            border-radius: 50%;
            background: #00ff9d;
            cursor: pointer;
        }
        .beat-label {
            color: #00ff9d;
            margin-right: 10px;
        }
        .market-effect {
            position: absolute;
            font-size: 2em;

    </audio>

    <script>
        const beatTrack = document.getElementById('beatTrack');
        let marketValue = 1000;
        let lastUpdate = 0;
        
        // Initialize audio
        beatTrack.volume = 0.5;
        beatTrack.play();
        
        // FX Functions
        function triggerFX(type) {
            const llama = document.getElementById('llamaImage');
            
            switch(type) {
                case 'pump':
                    marketValue *= 1.1;
                    llama.style.filter = 'hue-rotate(120deg) saturate(150%)';
                    showEffect('🚀 PUMP!', 'green');
                    break;
                case 'drop':
                    marketValue *= 0.9;
                    llama.style.filter = 'hue-rotate(300deg) saturate(150%)';
                    showEffect('📉 DROP!', 'red');
                    break;
                case 'chaos':
                    marketValue *= (Math.random() * 0.4 + 0.8);
                    llama.style.filter = `hue-rotate(${Math.random() * 360}deg) saturate(200%)`;
                    showEffect('🌪️ CHAOS!', 'purple');
                    break;
                case 'chill':
                    marketValue = 1000;
                    llama.style.filter = 'hue-rotate(180deg) saturate(80%)';
                    showEffect('🌴 CHILL', 'blue');
                    break;
            }
            
            setTimeout(() => {
                llama.style.filter = 'hue-rotate(0deg) saturate(100%)';
            }, 1000);
        }
        
        function showEffect(text, color) {
            const effect = document.createElement('div');
            effect.className = 'market-effect';
            effect.textContent = text;
            effect.style.color = color;
            effect.style.left = Math.random() * 80 + 10 + '%';
            effect.style.top = Math.random() * 80 + 10 + '%';
            
            document.body.appendChild(effect);
            
            // Fade in
            setTimeout(() => effect.style.opacity = '1', 10);
            
            // Float up and fade out
            setTimeout(() => {
                effect.style.transform = 'translateY(-100px)';
                effect.style.opacity = '0';
            }, 100);
            
            // Remove element
            setTimeout(() => effect.remove(), 1000);
        }
        
        // FX Pad
        const fxPad = document.getElementById('fxPad');
        fxPad.addEventListener('mousemove', (e) => {
            if (e.buttons !== 1) return;
            
            const rect = fxPad.getBoundingClientRect();
            const x = (e.clientX - rect.left) / rect.width;
            const y = 1 - (e.clientY - rect.top) / rect.height;
            
            // X controls color, Y controls market value
            const hueRotation = x * 360;
            const saturation = 100 + y * 100;
            document.getElementById('llamaImage').style.filter = 
                `hue-rotate(${hueRotation}deg) saturate(${saturation}%)`;
            
            marketValue = 500 + y * 1500;
        });
        
        // Audio Controls
        document.getElementById('volumeControl').addEventListener('input', (e) => {
            beatTrack.volume = e.target.value;
